import SuzyBaePic from "../assets/SuzyBaePic.png";
import UserInfoGrid from "./UserInfoGrid";
import { useState, useEffect } from "react";

const IMG_PATH = "https://image.tmdb.org/t/p/w500";
const SEARCH_API_URL =
  'https://api.themoviedb.org/3/search/movie?api_key=75e05708188d5f5a0a191495cf4a48db&language=en-US&page=1&include_adult=false&query="';

const UserProfile = ({ userData }) => {
  const [favMoviesName, setFavMoviesName] = useState(userData.topThreeMovies);
  const [favMoviesObjects, setFavMoviesObjects] = useState(["hi"]);

  console.log(userData.topThreeMovies)
 
  useEffect(() => {
    async function pushToArray(movieName) {
      const apiResponse = await get1Movie(SEARCH_API_URL + movieName);
      topThreeMoviesArray.push(apiResponse);
    }
    let topThreeMoviesArray = [];
    async function apiCallFavMovies(favMoviesName) {
      favMoviesName.forEach((movieName) => {
        pushToArray(movieName);
      });
      setFavMoviesObjects(topThreeMoviesArray);
    }
    apiCallFavMovies();
    console.log(favMoviesObjects);
  }, []);
  async function get1Movie(url) {
    const res = await fetch(url);
    const data = await res.json();
    let favMovie = getFirst(data.results)[0];
    returnMovieObjectSimple(favMovie);
  }

  function getFirst(array) {
    return array.slice(0, 1);
  }

  function returnMovieObjectSimple(movie) {
    const { title, poster_path, overview, release_date, vote_average } = movie;
    return {
      title: title,
      image: `${IMG_PATH}${poster_path}`,
      overview: overview,
      release_date: release_date,
      vote_average: vote_average,
    };
  }
  const [selectedUserInfo, setSelectedUserInfo] = useState("Fav Movies");

  const handleEdit = () => {};

  return (
    <div>
      <div class="flex items-center p-4 w-full">
        <div className="flex  flex-col">
          {/* User Information Section */}
          <div class="relative flex flex-col items-center w-80 h-60">
            <div class="h-40 w-40 md rounded-full relative avatar flex items-end justify-end text-purple-600 min-w-max absolute -top-16 flex bg-purple-200 text-purple-100 row-start-1 row-end-3 text-purple-650 ring-1 ring-white">
              <img
                class="h-40 w-40 md rounded-full relative"
                src={SuzyBaePic}
                alt=""></img>
              <div class="absolute"></div>
            </div>
            <div class="flex flex-col space-y-1 justify-center items-left -mt-12 w-80">
              <span class="font-bold text-xl text-center text-gray-800 hover:text-lime-500 hover:cursor-pointer ">
                {userData.name}
              </span>
              <p class="text-gray-600 text-sm text-center">
                @{userData.handle}
              </p>
              <p class="text-black-600 text-sm text-center">
                {userData.statusMsg}
              </p>
              <p class="text-black-600 text-sm text-center">
                {userData.additionalInfo}
              </p>

              {/* Follow & Message Buttons */}
              <div class="flex flex-row justify-center font-semibold mx-auto my-4 w-40">
                <div class="my-auto text-white bg-lime-500 hover:bg-lime-600 hover:cursor-pointer rounded-3xl py-2 px-4 mx-2">
                  Follow
                </div>
                <div
                  class="my-auto text-white bg-gray-400 hover:bg-gray-500 hover:cursor-pointer rounded-3xl py-2 px-4 mx-2"
                  onClick={handleEdit}>
                  Edit
                </div>
                {/* <div class="my-auto text-gray-800 py-1 px-4 border-2 border-lime-500 hover:bg-lime-500 hover:cursor-pointer hover:text-white rounded-3xl mx-2">Add to Box</div> */}
              </div>
            </div>
          </div>
        </div>
        {/* User TOP 3 Favorite Movies Display */}
        <div class="flex flex-row h-60 w-full justify-end">
          <div class="flex flex-row bg-lime-100 justify-center my-6 w-2/5 h-4/5 rounded-xl mr-8">
            {userData.topThreeMovies.map((movie) => (
              <div class="my-auto text-gray-800 border-2 border-yellow-500 mx-2 w-32 h-40 text-center">
                {movie}
              </div>
            ))}
          </div>
        </div>
      </div>
      {/* Bottom Tabs Section */}
      {/* Fav Movies, To Watch, Friends, Watch Groups */}
      <div class="text-sm flex flex-row w-full justify-center font-medium text-gray-500 border-b border-gray-200 dark:text-gray-400 dark:border-gray-700 mt-20 mb-8">
        <div class="flex -mb-px w-full justify-center">
          <div
            class="mr-2 w-1/4 flex justify-center"
            onClick={() => {
              setSelectedUserInfo("Fav Movies");
            }}>
            <span
              class={
                selectedUserInfo == "Fav Movies"
                  ? "inline-block p-4 text-lime-600 border-b-2 border-lime-600 rounded-t-lg active dark:text-lime-500 dark:border-lime-500"
                  : "inline-block p-4 border-b-2 border-transparent rounded-t-lg hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300"
              }>
              Fav Movies
            </span>
          </div>
          <div
            class="mr-2 w-1/4 flex justify-center"
            onClick={() => {
              setSelectedUserInfo("To Watch");
            }}>
            <span
              class={
                selectedUserInfo == "To Watch"
                  ? "inline-block p-4 text-lime-600 border-b-2 border-lime-600 rounded-t-lg active dark:text-lime-500 dark:border-lime-500"
                  : "inline-block p-4 border-b-2 border-transparent rounded-t-lg hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300"
              }>
              To Watch
            </span>
          </div>
          <div
            class="mr-2 w-1/4 flex justify-center"
            onClick={() => {
              setSelectedUserInfo("Friends");
            }}>
            <span
              class={
                selectedUserInfo == "Friends"
                  ? "inline-block p-4 text-lime-600 border-b-2 border-lime-600 rounded-t-lg active dark:text-lime-500 dark:border-lime-500"
                  : "inline-block p-4 border-b-2 border-transparent rounded-t-lg hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300"
              }>
              Friends
            </span>
          </div>
          <div
            class="mr-2 w-1/4 flex justify-center"
            onClick={() => {
              setSelectedUserInfo("Watch Groups");
            }}>
            <span
              class={
                selectedUserInfo == "Watch Groups"
                  ? "inline-block p-4 text-lime-600 border-b-2 border-lime-600 rounded-t-lg active dark:text-lime-500 dark:border-lime-500"
                  : "inline-block p-4 border-b-2 border-transparent rounded-t-lg hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300"
              }>
              Watch Groups
            </span>
          </div>
        </div>
      </div>
      <UserInfoGrid userData={userData} selectedUserInfo={selectedUserInfo} />
    </div>
  );
};

export default UserProfile;
